html{height:100%}body{height:100%;line-height:1;background:#192338;
font-family:roboto, helvetica, sans-serif, arial, verdana, tahoma;font-size:16px;color:#fff}
.container {width:100%;margin:0 auto;min-height:100%;position:relative;max-height:100vh;overflow:hidden; }
.container>.inner{position:absolute;top:50%;left:0;right:0;margin:0 auto;text-align:center;-webkit-transform:translateY(-50%);-moz-transform:translateY(-50%); transform:translateY(-50%);}
.container>.inner>.logo{display:inline-block;vertical-align:middle;text-decoration:none;margin-bottom:10px}
.container>.inner>.logo>.text{display:inline-block;vertical-align:middle;font-size:30px;color:#fff;font-weight:700}.container>.inner>.date{display:block;text-align:center;font-size:42px}
.container>.inner>.date>.day{color:#4b7aa2;font-weight:bold}.signed{display:block;width:400px;height:150px;margin-top:20px;margin:20px auto 0 auto;}
.signed>textarea {margin:0 auto;width:400px;height:150px;min-width:400px;max-width:400px;display:block;padding:15px;background:#fff;border:1px solid #4b7aa2;min-height:150px;max-height:150px;}p{margin:0 auto 20px auto;max-width:300px;}form.ddos_form .captcha-input{margin:0 auto 20px auto;display: block;width:300px;font-size:0;}form.ddos_form .captcha-input input{display:inline-block;vertical-align:top;height:50px;width:calc(100% - 150px);outline:0;border:none;font-size:16px;color:#000;padding:0 15px;line-height:50px;}form.ddos_form .captcha-input img{display:inline-block;vertical-align:top;}form.ddos_form button{border-radius:3px;display:block;width:300px;margin:0 auto;background:#4b7aa2;cursor:pointer;color:#fff;font-size:16px;text-transform:uppercase;text-align:center;height:40px;line-height:40px;outline:0;border:none;}

.container>.inner>.logo>.square {
display: inline-block;
vertical-align: middle;
width: 250px;
height: 100px;
background-position: center center;
background-repeat: no-repeat;
background-size: 250px;
}

.captchav2 {text-align: center;width: 100%;}

.image {
width: 20px;
height: 20px;
transform-origin: center;
transform: scale(6);
transition: all 0.2s ease-in;
border-radius: 50%;
box-shadow: 0 0 2px #4b7aa2;
margin:auto;
margin-bottom:60px;
margin-top:60px
}

input {
    text-align: center;
    text-transform: uppercase;
    background: #1a1e23;
    border: 1px solid #4b7aa2;
    color: #4b7aa2;
    font-size: 35px;
    margin: 1px;
    width: 40px;
    height: 40px;
}

.expire {
    display: inline-block;
    vertical-align: top;
    width: 100px;
    height: 50px;
    position: relative;
    background: #888;
    animation: timer-warning 1s 1;
    animation-fill-mode: forwards;
    animation-delay: 50s;
    margin-bottom: 6px;
    border-radius: 3px;
}

.expire>.timer {
    position: absolute;
    top: 0;
    left: 0;
    width: 100px;
    overflow: hidden;
}

.expire>.timer>.time-part-wrapper {
    display: inline-block;
    vertical-align: top;
    height: 50px;
    line-height: 50px;
    color: #fff;
}

.expire>.timer>.time-part-wrapper:first-child:after {
    content: ':';
    display: inline-block;
    vertical-align: top;
    width: 15px;
    height: 50px;
    line-height: 50px;
    text-align: center;
    font-size: 22px;
}

.expire>.timer>.time-part-wrapper>.time-part {
    display: inline-block;
    vertical-align: top;
    width: 15px;
    position: relative;
    animation: timer-expire;
    animation-fill-mode: forwards;
    animation-delay: 60s;
